import React from 'react';
import './Card.css';
import Carditem from './Carditem';

function Card(props) {
    return (
        <div className="cards">
            <h1>check out card</h1>
            <div className="cards__container">
                <div className="cards__wrapper">
                    <div className="cards__items">
                        <Carditem 
                            src="/images/img-9.jpg"
                            text="Waterfall"
                            label="Adventure"
                            path="/services"

                        />
                    </div>
                </div>
            </div>
        </div>
    )   
}

export default Card;
